							• **[classNames]** string data used for put CSS classes to extend the default CSS compoenent class<br>
							• **(action)** string data as event value emitted into the parent component`,
            }
        }
    },
};
export default meta;
export const _LiveSearchInputComponent = {
    args: {
        wrapperClassNames: '',
        classNames: ''
    }
};
